// Imports.
import React from 'react';
import CalculatorTitle from './calculatorTitle.js';
import OutputScreen from './outputScreen.js';
import Button from './Button.js';

class Calculator extends React.Component {

    constructor(props) {
        super(props)
    
        this.state = {
                    
        }
    }
    
	render()
	{
	return (
	<div className="frame">
	<CalculatorTitle value="Calculator"/>
	<div class="mainCalc">
	<OutputScreen/>
	<div className="button-row">
	<Button label={'Clear'}/>
	<Button label={'Delete'}/>
	<Button label={'.'}/>
	<Button label={'/'}/>
	</div>
	<div className="button-row">
	<Button label={'7'}/>
	<Button label={'8'}/>
	<Button label={'9'}/>
	<Button label={'*'}/>
	</div>
	<div className="button-row">
	<Button label={'4'}/>
	<Button label={'5'}/>
	<Button label={'6'}/>
	<Button label={'-'}/>
	</div>
	<div className="button-row">
	<Button label={'1'}/>
	<Button label={'2'}/>
	<Button label={'3'}/>
	<Button label={'+'}/>
	</div>
	<div className="button-row">
	<Button label={'0'}/>
	<Button label={'='}/>
	</div>
	</div>
	</div>
	);
}
}

// Export Calculator Component.
export default Calculator;
